import React, { useState } from "react";
import "./signup.css";
import "../theme.css";
import { Input } from "../../components/SignupComponents/Input";
import { Link } from "react-router-dom";

export const SignUpPage = () => {
  const [username, setUsername] = useState("");
  const [name, setName] = useState("");
  const [password, setPassword] = useState("");

  const logoOne = require("./wallet.png");

  <Link to={`/${pageForward}/${id}`}>
    <div className="click">
      <button type="button" className="next">
        NEXT
      </button>
    </div>
  </Link>;

  return (
    <div className="screen">
      <div className="page">
        <div className="center">
          <div className="flex-col flex justify-center items-center mb-4 relative">
            <img src={logoOne} alt="alt" className="h-16 " />
            <h1 className="font-bold text-xl text-indigo-600">WalletWise</h1>
          </div>

          <div className="p-10 flex flex-col justify-between rounded-xl login">
            <div className="pic">
              <div className="uploadpic"></div>
              <h1 className="addpic  font-semibold mt-2 mb-5">
                Add a profile picture!
              </h1>
            </div>
            <Input
              type="email"
              placeholder={"first.last@mail.com"}
              header="Email:"
              value={username}
              setter={setUsername}
            />
            <Input
              type="username"
              placeholder={"first and last name"}
              header="First and Last Name:"
              value={name}
              setter={setName}
            />
            <Input
              type="password"
              placeholder={"password1234"}
              header="Password:"
              value={password}
              setter={setPassword}
            />

            <Link to={`/`}>
              <div className="click">
                <button type="button" className="next">
                  NEXT
                </button>
              </div>
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};
